import { Link, NavLink } from 'react-router-dom';

function Header() {
  const clickStyle = { color: 'red' };

  const scrollToSection = (sectionId) => {
    const section = document.getElementById(sectionId);
    if (section) {
      section.scrollIntoView({
        behavior: 'smooth',
      });
    }
  };

  return (
    <header>
      <meta
        name="viewport"
        content="width=device-width, initial-scale=1, maximum-scale=1, user-scalable=0"
      />
      <div className="inner">
        <h1 className="logo">
          <Link exact to="/react_portfolio">
            Branden Min
          </Link>
        </h1>
        <ul className="gnb">
            <li><NavLink to="/react_portfolio">About</NavLink></li>
            <li><Link onClick={() => scrollToSection('projects')}>PROJECTS</Link></li>
            <li><Link to="/react_portfolio#experiences">EXPERIENCES</Link></li>
            <li><Link to="/react_portfolio#skills">SKILLS</Link></li>
            <li><NavLink onClick={() => window.open('/react_portfolio/BrandenMin.pdf', '_black')} to="/Cv">CV</NavLink></li>
        </ul>
        <div className="snsContact">
          <a href="https://www.linkedin.com/in/brandenmin/" target="_blank">
            <i className="fa-brands fa-linkedin"></i>
          </a>
          <a href="https://github.com/Gemnnn" target="_blank">
            <i className="fa-brands fa-github"></i>
          </a>
          <a href="#">
            <i className="fa-brands fa-facebook"></i>
          </a>
        </div>
      </div>
    </header>
  );
}

export default Header;
